pragma solidity >=0.8.0 < 0.9.0;

contract Loop {

    //솔리디티엔 for, while, doWhile 문이 있음.
    function forLoop() public {
        uint8 sum = 0;
        for(uint8 i=1; i<11; i++) {
            sum+= 1;
        }
    }

}

